import React, { useState } from 'react';
// import logo from '../images/logo.png';
import ToggleButton from 'react-toggle-button';


class Nav extends React.Component {
  render(props){
    return (
      <nav>
        <ul>
          <li>logo</li>
        </ul>
        <ul>
          <ToggleButton
            value={ props.state.value || false }
            onToggle={(value) => {
              props.self.setState({
                value: !value,
              })
            }} 
          />
        </ul>
      </nav>
    );
  }

}

export default Nav;
